    const center = { lat: 48.8584, lng: 2.2945 }

    const [zoom, setZoom] = useState(0);

    return (
        <LoadScript googleMapsApiKey="AIzaSyA_WC7fO9PYuaWNHV4Bg5nw_Q_O6VLzLfo">
            <GoogleMap
                center={center}
                zoom={zoom}
                mapContainerStyle={{width: '500px', height: '500px'}}
                onMouseDown={setZoom(1)}
            >

            </GoogleMap>

        </LoadScript>
    )
}
